import React from "react";
import './App.css';
import {BrowserRouter as Router, Link, Route} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Link to="/">Home</Link>
        <Link to="/view-invoice">View Invoice</Link>
        <Link to="/create-invoice">Create Invoice</Link>
        <Link to="/edit-invoice">Edit Invoice</Link>

        <switch>
          <Route exact path="/">
            <Home />
          </Route>

          <Route exact path="/">
            <ViewInvoice />
          </Route>

          <Route exact path="/">
            <CreateInvoice />
          </Route>

          <Route exact path="/">
            <Home />
          </Route>
        </switch>
      </Router>
    </div>
  );
}

export default App;
